// from http://pivotallabs.com/users/alex/blog/articles/427-xpath-css-class-matching
function containingClass(className) {
	return "contains(concat(' ',normalize-space(@class),' '),' " + className + " ')";
}

// from http://commons.oreilly.com/wiki/index.php/Greasemonkey_Hacks/Getting_Started
function addGlobalStyle(css) {
	try {
		var elmHead, elmStyle;
		elmHead = document.getElementsByTagName('head')[0];
		elmStyle = document.createElement('style');
		elmStyle.type = 'text/css';
		elmHead.appendChild(elmStyle);
		elmStyle.innerHTML = css;
	} catch (e) {
		if (!document.styleSheets.length) {
			document.createStyleSheet();
		}
		document.styleSheets[0].cssText += css;
	}
}

// from http://stackoverflow.com/questions/442404/dynamically-retrieve-html-element-x-y-position-with-javascript
function getOffset( el ) {
    var _x = 0;
    var _y = 0;
    while( el && !isNaN( el.offsetLeft ) && !isNaN( el.offsetTop ) ) {
        _x += Math.max(0, el.offsetLeft - el.scrollLeft);
        _y += Math.max(0, el.offsetTop - el.scrollTop);
        el = el.offsetParent;
    }
    return { top: _y, left: _x };
}

function setMessage(message) {

	var sideDiv = document.evaluate(".//div[" + containingClass("side") + "]",
		document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
		
	if (sideDiv) {
		addGlobalStyle(".f7u12message {border: 1px solid black; background-color: #FFB368; padding: 3px; text-align: center;}");
		var messageDiv = document.createElement('div');
		messageDiv.className = "spacer f7u12message";
		messageDiv.innerHTML = message;
		
		sideDiv.insertBefore(messageDiv, sideDiv.firstChild);
	}
}

function setMessageAndCheckCanVote(jsonResponse) {
	var result = JSON.parse(jsonResponse);
	
	setMessage(result.message);
	
	if (GlobalData.username) {
		setupVoteTable();
		GlobalData.canVote = result.canvote;
	}
	
	getFaceIdsForLinkRefs();
}

function getUsername() {
	var userSpan = document.evaluate("//span[" + containingClass("user") + "]/a",
		document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
		
	if (userSpan && userSpan.href.toLowerCase().indexOf("http://www.reddit.com/user/") != -1) {
		GlobalData.username = userSpan.innerHTML;
	}
	else {
		GlobalData.username = null;
	}
}

function getLinkRefs() {
	var snapThingElems = document.evaluate("//div[@id='siteTable']/div[" + containingClass("link") + "]",
		document, null, XPathResult.ORDERED_NODE_SNAPSHOT_TYPE, null);
		
	GlobalData.linkRefs = [];
	for (var i = 0; i < snapThingElems.snapshotLength; i++) {
		var thingElem = snapThingElems.snapshotItem(i);
		
		if (thingElem.className.indexOf('promotedlink') == -1) {
			var re = /id-t3_(\w+)/;
			var m = re.exec(thingElem.className);
			if (m && m.length > 1 && m[1]) {
				var ref = m[1];
				GlobalData.linkRefs[ref] = new Object;
				GlobalData.linkRefs[ref].elem = thingElem;
			}
		}
	}
}

function getFaceIdsForLinkRefs() {	
	for (var ref in GlobalData.linkRefs) {
		var postdata = "linkref=" + ref;
		if (GlobalData.username) {
			postdata += "&username=" + GlobalData.username;
		}
		
		GM_xmlhttpRequest({
			method: "get",
			url: GlobalData.serverName + "/getface?" + postdata,
			onload: function(e) { showFace(e.responseText); },
			onerror: function(e) { } 
		});
	}
}

function showFace(response) {
	var spaceIndex = response.indexOf(" ");
	if (spaceIndex < 0) {
		return;
	}
	
	var faceId = parseInt(response.substring(0, spaceIndex));
	if (isNaN(faceId)) {
		faceId = -1;
	}
	
	var ref = response.substring(spaceIndex+1);
	if (!(ref in GlobalData.linkRefs)) {
		return;
	}
	
	var thumbAnchor = document.evaluate(".//a[" + containingClass("thumbnail") + "]",
		GlobalData.linkRefs[ref].elem, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
		
	var newImg = document.createElement('img');
	newImg.alt = "";
	
	var usingOldImg = false;
	if (faceId >= 0 && faceId < GlobalData.faces.length) {
		newImg.src = GlobalData.faces[faceId];
	}
	else if (!GlobalData.canVote) {
		return;
	}
	else {
		newImg.src = GlobalData.placeholderImg;
	}
	
	
	// If there is no face result but an image tumbnail already exists, try to use the existing one
	if (faceId < 0 && thumbAnchor) {
		var thumbImg = document.evaluate(".//img",
			thumbAnchor, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
			
		if (thumbImg) {
			newImg.src = thumbImg.src;
			usingOldImg = true;
		}
	}
	
	
	if (GlobalData.username && GlobalData.voteDiv) {
		newImg.addEventListener("click", function(event) { showVoteOptions(event.target); }, true);
	}
	
	var newAnchor = document.createElement('a');
	if (faceId >= 0 || usingOldImg) {
		newAnchor.className = "thumbnail addpointer";
	}
	else {
		newAnchor.className = "thumbailph addpointer";
	}
	newAnchor.appendChild(newImg);
		
	if (thumbAnchor) {
		thumbAnchor.parentNode.replaceChild(newAnchor, thumbAnchor);
	}
	else {
		var entryDiv = document.evaluate(".//div[" + containingClass("entry") + "]",
			GlobalData.linkRefs[ref].elem, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
			
		if (entryDiv != null) {
			GlobalData.linkRefs[ref].elem.insertBefore(newAnchor, entryDiv);
		}
	}
}

function clearVoteOptions() {
	GlobalData.voteDiv.style.display = "none";
}

function showVoteOptions(target) {
	var oldAnchor = GlobalData.votingAnchor;
	GlobalData.votingAnchor = null;
	GlobalData.votingRedditRef = null;
	clearVoteOptions();
	if (GlobalData.username && GlobalData.voteDiv && target && target.parentNode && target.parentNode.parentNode) {
		var re = /id-t3_(\w+)/;
		var m = re.exec(target.parentNode.parentNode.className);
		if (m != null && m.length > 1 && m[1] != null) {
			GlobalData.votingRedditRef = m[1];
			GlobalData.votingImg = target;
			GlobalData.votingAnchor = target.parentNode;
			
			var titleAnchor = document.evaluate(".//a[" + containingClass("title") + "]",
				target.parentNode.parentNode, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
				
			if (titleAnchor) {
				GlobalData.votingLinkUrl = titleAnchor.href;
			}
			
			if (oldAnchor == GlobalData.votingAnchor) {
				GlobalData.votingAnchor = null;
				GlobalData.votingRedditRef = null;
				GlobalData.votingLinkUrl = null;
				GlobalData.voteDiv.style.display = "none";
			}
			else {
				var offset = getOffset(target);
				offset.top += 16;
				
				GlobalData.voteDiv.style.display = "block";
				GlobalData.voteDiv.style.top = offset.top + "px"
				GlobalData.voteDiv.style.left = offset.left + "px"
			}
		}
	}
}

function setupVoteTable() {
	var rowSize = 10;
	var voteTable = document.createElement('table');
	voteTable.className = "votetable";
	addGlobalStyle(".votetable {border: 1px solid black;}");
	addGlobalStyle(".votetable tr td {background: white; padding: 2px; text-align: center;}");
	addGlobalStyle(".hoverborder {border: 1px solid white;}");
	addGlobalStyle(".hoverborder:hover {border: 1px solid black;}");
	addGlobalStyle(".votetable .closebutton { text-align: right; padding: 0px 3px;}");
	
	var closeText = document.createTextNode("close"); 
	var closeAnchor = document.createElement('a');
	closeAnchor.href = "javascript:void";
	closeAnchor.addEventListener("click", function(event) { clearVoteOptions(); }, true);
	var closeCell = document.createElement('td');
	closeCell.colSpan = "" + rowSize;
	closeCell.className = "closebutton";
	var closeRow = document.createElement('tr');
	closeAnchor.appendChild(closeText);
	closeCell.appendChild(closeAnchor);
	closeRow.appendChild(closeCell);
	voteTable.appendChild(closeRow);
	
	var cellNum = 0;
	var curRow = null
	for (index in GlobalData.faces) {
		if (curRow == null || cellNum == rowSize) {
			curRow = document.createElement('tr');
			voteTable.appendChild(curRow);
			cellNum = 0;
		}
		
		var curCell = document.createElement('td');
		curCell.className = "addpointer ";
		
		var curCellImg = document.createElement('img');
		curCellImg.src = GlobalData.faces[index];
		curCellImg.className = "hoverborder " + GlobalData.faceIdPrefix + index;
		curCellImg.addEventListener("click", function(event) { vote(event.target); }, true);
			
		curCell.appendChild(curCellImg);
		curRow.appendChild(curCell);
		
		cellNum++;
	}
	
	var div = document.createElement('div');
	div.style.display = "none";
	div.style.position = "absolute";
	div.appendChild(voteTable);
	GlobalData.voteDiv = div;
	
	var body = document.getElementsByTagName('body')[0];
	body.appendChild(div);
}

function vote(target) {
	faceId = parseInt(target.className.substring(target.className.indexOf(GlobalData.faceIdPrefix) + GlobalData.faceIdPrefix.length));
	
	if (GlobalData.canVote && GlobalData.username && GlobalData.votingRedditRef && GlobalData.votingLinkUrl && faceId >= 0) {
		GM_xmlhttpRequest({
			method: "post",
			url: GlobalData.serverName + "/vote",
			headers: { "Content-type" : "application/x-www-form-urlencoded" },
			data: encodeURI("username=" + GlobalData.username + "&redditref=" + GlobalData.votingRedditRef + 
							"&faceid=" + faceId + "&linkurl=" + GlobalData.votingLinkUrl),
			onload: function(e) { updateFace(faceId); },
			onerror: function(e) { } 
		});
	}
	
	clearVoteOptions();
}

function updateFace(faceId) {
	GlobalData.votingImg.src = GlobalData.faces[faceId];
	GlobalData.votingAnchor.className = "thumbnail addpointer";
	GlobalData.votingAnchor = null;
	GlobalData.votingRedditRef = null;
}

